    console.log(stringValues);
    var gameDeck = [];

    var game = stringValues[0];
    for (const property in stringValues) {
        gameDeck = stringValues[property-1];
    }

    console.log("Game: "+game);
    console.log("GameDeck: "+gameDeck);

